--CUSTOMERS tablosunu oluþturma:
CREATE TABLE CUSTOMERS(
ID INT IDENTITY(1,1),
CUSTOMERNAME VARCHAR(100),
TCNUMBER VARCHAR(11),
GENDER VARCHAR(1),
EMAIL VARCHAR(100),
BIRTHDATE DATE,
CITYID INT,
DISTRICTD INT,
TELNR1 VARCHAR(15),
TELNR2 VARCHAR(15)
CONSTRAINT PK_CUSTOMERS PRIMARY KEY CLUSTERED (ID ASC))


--DISTRICT tablosunu oluþturma:
CREATE TABLE DISTRICT (
ID INT IDENTITY(1,1),
CITYID INT,
DISTRICT VARCHAR(50)
CONSTRAINT PK_DISTRICT  PRIMARY KEY CLUSTERED (ID ASC))


--CITIES tablosunu oluþturma:
CREATE TABLE CITIES(
ID INT IDENTITY(1,1),
CITY VARCHAR(50),
CONSTRAINT PK_CITIES PRIMARY KEY CLUSTERED (ID ASC))


















